Ich suche ein Ranked 5v5 Team. Ich bin Main Jungle seit anfang Season 5. Ich habe in letzer Season kaum Ranked gespielt und bin deswegen Bronze. 
Ich wurde gerade am Ende vorletzter Season [S4] LvL 30 und wurde dann in der Preseason Silver 2. Am Anfang der n&auml;chsten Season hatte ich dann Pech in den Placements und startete in Bronze. Ich hatte in der ganzen letzten Season daraufhin kein Bock mehr Ranked zu spielen, weil ich mich nicht aus Bronze rausqu&auml;len wollte. Ich kann sonst Jungle und Mid, auch etwas Top, spielen. Support evtl. auch aber definitiv kein ADC. Ich habe allerdings eine Menge Jungle Erfahrung und w&uuml;rde es sehr begr&uuml;&szlig;en wenn ihr nicht zu schnell urteilt und mich vorspielen lasst ^^. Bei Nachfrage kann ich euch meinen Champion Pool mitteilen.{{champion:432}} 
MfG ArtCrane.
